import React, { Component } from 'react'
import ListItemCard from './ListItemCard'

export class ListItemsTable extends Component {
    moveUp = () => {
        console.log("HELLLO");
        const index = this.state.currentList.indexOf()
        // const index = this.state.todoLists.indexOf(this.state.currentList);
        // if (index > 0) {
        //   const temp = this.state.todoLists[index];
        //   this.state.todoLists[index] = this.state.todoLists[index-1];
        //   this.state.todoLists[index-1] = temp;
        // }
    }
    render() {
        return (
            <div id="list_items_container">
                <div className="list_item_header_card">
                <div className="list_item_task_header">Task</div>
                <div className="list_item_due_date_header">Due Date</div>
                <div className="list_item_status_header">Status</div>
                </div>
                {
                    this.props.todoList.items.map((todoItem)=>(
                        <ListItemCard 
                            key={todoItem.key}
                            todoList={this.props.todoList}
                            listItem={todoItem} 
                            moveUp={this.moveUp(todoItem)}/>
                    ))
                }
            </div>
        )
    }
}

export default ListItemsTable
